import React,{Component} from 'react'
import './App.css';
import stateVideo from './stateVideo'
import Nav from './component/Nav'

class App extends Component{

  state={
    video:stateVideo
  }

  allVideo=this.state.video
           .maps(item =><option value={item}/>)


  render(){
    return (
      <Nav allTitleVideo={this.allVideo}></Nav>
    );
  }
}

export default App;
